import React from "react";
import { useParams } from "react-router-dom";

const Finalpage = () => {
  // Accessing parameters from the URL
  const { courseId } = useParams();

  // Assuming you have some data structure containing details for each course
  const courseDetails = {
    id: 1,
    cover:
      "https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcT4uWeqKZyNNK0T5286vGRtamL7r52oZEe9NQ&usqp=CAU",
    coursesName: "Front-End",
    youtubeVideoURL:
      "https://www.youtube.com/watch?v=BsDoLVMnmZs&ab_channel=CodeWithHarry",
    reflink: "/courses",
    courTeacher: [
      {
        dcover: "./images/logo.png",
        name: "by AppTechTell",
        totalTime: "25 lectures (40 hrs)",
        link1: "",
        link2: "",
        link3: "",
      },
    ],
  };

  if (!courseDetails) {
    // Handle the case where the course details are not available
    return <div>Course not found</div>;
  }

  return (
    <div className="final-page">
      <div className="course-details">
        <h1>{courseDetails.coursesName}</h1>
        {/* Add more details as needed */}
      </div>
      <div className="video-container">
        {/* Embed the YouTube video using an iframe */}
        <iframe
          width="560"
          height="315"
          src={courseDetails.youtubeVideoURL}
          title="YouTube video player"
          frameBorder="0"
          allow="accelerometer; autoplay; clipboard-write; encrypted-media; gyroscope; picture-in-picture"
          allowFullScreen
        ></iframe>
      </div>
      {/* Add more content based on your requirements */}
    </div>
  );
};

export default Finalpage;
